'''Tuilérë''' was one of several feast-days that appeared in the calendars of [[Gondor]].  It lay between the months of [[Súlimë]] and [[Víressë]], and marked the beginning of spring. On a modern calendar, it fell on 23 March.<ref>{{App|Calendars}}</ref>

